import React from 'react'
import './Fourth.css'
import { FourthDetail } from './FourthDetail'

export const Fourth = () => {
  return (
    <div className='fourth-container'>
        <div className='fourth-image'>
            <div className='fourth-details-container'></div>
            <FourthDetail icon="pi-check" counter="450" title="Works Completed"/>
        </div>
    </div>
  )
}
